import React, { useState } from "react";

export default function Category() {
  // const [category, setCategory] = useState([]);
  const category = [
    { name: "Mũ bảo hiểm 3/4 đầu", icon: "", link: "" },
    { name: "Mũ bảo hiểm Fullface", icon: "", link: "" },
    { name: "Mũ bảo hiểm lật cằm", icon: "", link: "" },
    { name: "Mũ bảo hiểm 1/2 đầu", icon: "", link: "" },
    { name: "Kính Mũ bảo hiểm", icon: "", link: "" },
  ];

  const price = [
    { name: "Dưới 500.000 đ", price: "" },
    { name: "Từ 500.000 đ - 700.000 đ", price: "" },
    { name: "Từ 700.000 đ - 100.000 đ", price: "" },
    { name: "Trên 1.000.000 đ", price: "" },
  ];
  return (
    <div className="row">
      <div className="col-sm-3">
        <div className="category">
          <div className="category-item">
          <ul >
            {category.map((item) => (
              <li>{item.name}</li>
            ))}
          </ul>
          </div>
        </div>
      </div>
    </div>
  );
}
